script: |
  super -f text -I q6169.spq | sort > q6169.out

inputs:
  - name: q6169.spq
    data: |
      SELECT ALL 70 AS col2 FROM tab0 (FORMAT parquet) WHERE + ( + + col0 ) NOT IN ( + col0 * + col1 - + + col0, col1 + col0 );
  - name: tab0

outputs:
  - name: q6169.out
    data: |
      70
      70
      70
